//Модел на пипало на тетрапод
MEIRO.TetrapodTentacle = function()
{
	THREE.Object3D.call(this);

	var body = new THREE.Mesh( MEIRO.TetrapodTentacle.geomBody, MEIRO.TetrapodTentacle.material );
	body.position.set(0,1.5,0);
	this.add(body);

	var cap = new THREE.Mesh( MEIRO.TetrapodTentacle.geomCap, MEIRO.TetrapodTentacle.material );
	cap.scale.set(1.03,0.4,1.03);
	cap.position.set(0,2.93,0);
	this.add(cap);
}
MEIRO.TetrapodTentacle.prototype = Object.create(THREE.Object3D.prototype);

//Модел на тетрапод
MEIRO.Tetrapod = function()
{
	THREE.Object3D.call(this);

	var body = new MEIRO.TetrapodTentacle();
	this.add(body);

	for (var i=0; i<3; i++)
	{
		body = new MEIRO.TetrapodTentacle();
		body.rotation.set(0,i*2*Math.PI/3,THREE.Math.degToRad(-115));
		this.add(body);
	}
}
MEIRO.Tetrapod.prototype = Object.create(THREE.Object3D.prototype);



// конструктор на модела
MEIRO.Models.M10091 = function M10091(room)
{
	MEIRO.Model.apply(this, arguments);

	// преобразувано с http://dataurl.net/#dataurlmaker
	var concreteData = 'data:image/jpeg;base64,';
	
	var concrete = new THREE.TextureLoader().load(concreteData);
	concrete.repeat.set(3,1);
	concrete.wrapS = THREE.RepeatWrapping;
	concrete.wrapT = THREE.RepeatWrapping;
	
	MEIRO.TetrapodTentacle.geomBody = new THREE.CylinderGeometry(0.8,1.4,3,options.lowpoly?8:24,1,true);
	MEIRO.TetrapodTentacle.geomCap = new THREE.SphereGeometry(0.8,options.lowpoly?8:24,options.lowpoly?3:6,0,2*Math.PI,0,Math.PI/2-0.2);
	MEIRO.TetrapodTentacle.material = new THREE.MeshLambertMaterial({color:'white',map:concrete});

	tetrapod = new MEIRO.Tetrapod();
	
	var light = new THREE.AmbientLight('white',0.1);
	
	// сглобяване на целия модел
	this.image.add(tetrapod,light);
}

MEIRO.Models.M10091.prototype = Object.create(MEIRO.Model.prototype);

MEIRO.Models.M10091.DIST = {MIN:5, MAX:30, HEIGHT:0};
MEIRO.Models.M10091.POS = {DIST:10, ROT_X:0, ROT_Y:0.1};
MEIRO.Models.M10091.ROT_Y = {MIN:-0.1, MAX:0.7};


// аниматор на модела
MEIRO.Models.M10091.prototype.onAnimate = function(time)
{
}



// информатор на модела
MEIRO.Models.M10091.prototype.onInfo = function(element)
{
	var s = '';
	s += '<h1>Бетонен тетрапод</h1>';

	s += '<p>Тетрапод означава нещо с 4 крака. Бетонните тетраподи са съставени от 4 еднотиплни елемента, всеки от които е пресечен конус със заоблен край &ndash; част от сфероид.</p>';
	
	element.innerHTML = s;
}
